import "./MostPopular.css";
import { MostPopularCard, Title } from "../../components/index";
import image1 from "../../assets/images/popular-01.jpg";
import image2 from "../../assets/images/popular-02.jpg";
import image3 from "../../assets/images/popular-03.jpg";
import image4 from "../../assets/images/popular-04.jpg";
import image5 from "../../assets/images/popular-05.jpg";
import image6 from "../../assets/images/popular-06.jpg";
import image7 from "../../assets/images/popular-07.jpg";
import image8 from "../../assets/images/popular-08.jpg";
function MostPopular() {
  return (
    <div className="section-wrapper">
      <Title titlePrimary="Most Popular  " />
      <div className="most-popular-items">
        <MostPopularCard
          image={image1}
          name="Fortnight"
          type="sandbox"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image2}
          name="PubG"
          type="Battle S"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image3}
          name="Dota2"
          type="Steam-X"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image4}
          name="CS-GO"
          type="Legendary"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image5}
          name="Craft"
          type="Legendary"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image6}
          name="Warcraft"
          type="Legendary"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image7}
          name="Warface"
          type="Max 3D"
          rate="3"
          download="3.M"
        />
        <MostPopularCard
          image={image8}
          name="Eagles Fly"
          type="Matrix Games"
          rate="3"
          download="3.M"
        />
      </div>
    </div>
  );
}

export default MostPopular;
